import { Box, Typography } from "@mui/material"






export const Feature = ({ title, text }) => {
    const StylesForSame = {
        color: 'white',
        textTransform: 'none'
    }
    
    return (
        <> 

      <Box>

     
                 <Typography
                 gutterBottom
                    sx={{...StylesForSame,width:'100%'}}
                    variant="h6"

                >
                    {title}
                </Typography>

             
                <Typography
                gutterBottom
                    sx={{...StylesForSame, width:'100%'}}

                    variant="subtitle2"
                     
                >
                    {text}
                </Typography>
          </Box>
            
        </>
    )
}
